provisions, end-user policies, and disclosure restrictions. Upon discovery of potential infringement of our intellectual property, we assess and when necessary, take action to protect our rights as appropriate. We also enter into confidentiality agreements and invention assignment agreements with our employees and consultants and seek to control access to, and distribution of, our proprietary information in a commercially prudent manner. The efforts we have taken and may take to protect our intellectual property may not be sufficient or effective. For example, effective intellectual property protection may not be available in every country in which we currently or in the future will operate. In addition, it may be possible for other parties to copy or reverse-engineer our products and offerings or obtain and use the content of our website without authorization. Further, we may be unable to prevent competitors or other third parties from acquiring or using domain names or trademarks that are similar to, infringe upon, or diminish the value of our domain names, trademarks, service marks, and other proprietary rights. Moreover, our trade secrets may be compromised by third parties or our employees, which would cause us to lose the competitive advantage derived from the compromised trade secrets. Further, we may be unable to detect infringement of our intellectual property rights, and even if we detect such violations and decide to enforce our intellectual property rights, we may not be successful, and may incur significant expenses, in such efforts. In addition, any such enforcement efforts may be time-consuming and may divert management’s attention. Further, such enforcement efforts may result in a ruling that our intellectual property rights are unenforceable or invalid. Any failure to protect or any loss of our intellectual property may have an adverse effect on our ability to compete and may adversely affect our business, financial condition, or operating results.

Companies in the Internet and technology industries, and other patent and trademark holders, including “non-practicing entities,” seeking to profit from royalties in connection with grants of licenses or seeking to obtain injunctions, own large numbers of patents, copyrights, trademarks, and trade secrets and frequently enter into litigation based on allegations of infringement or other violations of intellectual property rights. We have and may in the future continue to receive notices that claim we have misappropriated, misused, or infringed upon other parties’ intellectual property rights.

Furthermore, from time to time we may introduce or acquire new products, including in areas in which we historically have not operated, which could increase our exposure to patent and other intellectual property claims. In addition, we, and companies we acquired or in which we have an interest, have been sued, and may in the future be sued, for allegations of intellectual property infringement or threats of trade secret misappropriation. If a company we acquire or in which we have an interest loses rights to valuable intellectual property or is found to infringe third party intellectual property rights in such lawsuits, the value of our investment may materially decline.

